import React from "react";
import "./Scroll.css";
import { BsSkipEnd } from "react-icons/bs";
export default function Scroll() {
  return (
    <div>
      <button className="btn_scroll">
        <span className="btn_scroll-icon">
          <BsSkipEnd />
        </span>
      </button>
    </div>
  );
}
